import { ThemeToggle } from "@/client/theme/ThemeToggle";
import React, { useState, useEffect } from "react";
import Link from "next/link";
import { usePathname } from "next/navigation";

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isScrolled, setIsScrolled] = useState(false);

  const router = usePathname();

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  useEffect(() => {
    const handleScroll = () => {
      const scrollTop = window.pageYOffset;

      setIsScrolled(scrollTop > 30);
    };

    window.addEventListener("scroll", handleScroll);

    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, []);

  const getLinkClass = (path: string) => {
    return router === path
      ? "block py-2 px-3 text-white bg-green-700 rounded md:bg-transparent md:text-green-700 md:p-0 md:dark:text-green-500"
      : "block py-2 px-3  rounded hover:bg-gray-100 md:hover:bg-transparent md:hover:text-green-700 md:p-0 md:dark:hover:text-green-500  dark:hover:bg-gray-700 dark:hover:text-white md:dark:hover:bg-transparent dark:border-gray-700";
  };

  return (
    <div>
      <nav
        className={`fixed w-full z-50 top-0 start-0 transition-all duration-300 ${
          isScrolled
            ? "bg-white dark:bg-gray-900"
            : router === "/"
            ? "bg-transparent text-white"
            : ""
        }`}
      >
        <div className="max-w-screen-xl flex flex-wrap items-center justify-between mx-auto p-4">
          <Link
            href="/"
            className="flex items-center space-x-3 rtl:space-x-reverse"
          >
            <img src="/favicon.png" className="h-8" alt="upperz" />
            <span className="self-center text-xl font-semibold whitespace-nowrap ">
              compact
            </span>
          </Link>

          <div className="flex items-center md:order-2 space-x-3 md:space-x-0 rtl:space-x-reverse">
            <Link href="/contact">
              <button
                type="button"
                className="text-white bg-green-600 hover:bg-green-800 focus:ring-4 focus:outline-none focus:ring-green-300 font-medium rounded-lg text-sm sm:px-12 px-4 py-2 text-center dark:bg-green-600 dark:hover:bg-green-700 dark:focus:ring-green-800"
              >
                Contact
              </button>
            </Link>
            <div className="max-sm:hidden">
              <ThemeToggle />
            </div>

            <button
              onClick={toggleMenu}
              type="button"
              className="inline-flex items-center p-2 w-10 h-10 justify-center text-sm text-gray-500 rounded-lg md:hidden hover:bg-gray-100 focus:outline-none focus:ring-2 focus:ring-gray-200 dark:text-gray-400 dark:hover:bg-gray-700 dark:focus:ring-gray-600"
              aria-controls="navbar-sticky"
              aria-expanded={isMenuOpen ? "true" : "false"}
            >
              <span className="sr-only">Open main menu</span>
              {!isMenuOpen ? (
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  width="24"
                  height="24"
                  viewBox="0 0 24 24"
                  fill="none"
                  stroke="currentColor"
                  strokeWidth="2"
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  className="lucide lucide-align-justify"
                >
                  <line x1="3" x2="21" y1="6" y2="6" />
                  <line x1="3" x2="21" y1="12" y2="12" />
                  <line x1="3" x2="21" y1="18" y2="18" />
                </svg>
              ) : (
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  width="24"
                  height="24"
                  viewBox="0 0 24 24"
                  fill="none"
                  stroke="currentColor"
                  strokeWidth="2"
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  className="lucide lucide-x"
                >
                  <path d="M18 6 6 18" />
                  <path d="m6 6 12 12" />
                </svg>
              )}
            </button>
          </div>
          <div
            className={`items-center justify-between ${
              isMenuOpen
                ? "block bg-white dark:bg-gray-900 text-black  dark:text-white"
                : "hidden"
            } w-full md:flex md:w-auto md:order-1`}
            id="navbar-sticky"
          >
            <ul className="flex flex-col p-4 md:p-0 mt-4 font-medium border border-gray-100 rounded-lg md:space-x-8 rtl:space-x-reverse md:flex-row md:mt-0 md:border-0   dark:border-gray-700">
              <li>
                <Link
                  href="/"
                  className={getLinkClass("/")}
                  onClick={() => setIsMenuOpen(false)}
                >
                  Acceuil
                </Link>
              </li>
              <li>
                <Link
                  href="/about"
                  className={getLinkClass("/about")}
                  onClick={() => setIsMenuOpen(false)}
                >
                  Apropos
                </Link>
              </li>
              <li>
                <Link
                  href="/resource"
                  className={getLinkClass("/resource")}
                  onClick={() => setIsMenuOpen(false)}
                >
                  Resources
                </Link>
              </li>
              <li>
                <Link
                  href="/portofolio"
                  className={getLinkClass("/portofolio")}
                  onClick={() => setIsMenuOpen(false)}
                >
                  Portofolio
                </Link>
              </li>
              <li>
                <Link
                  href="/blog"
                  className={getLinkClass("/blog")}
                  onClick={() => setIsMenuOpen(false)}
                >
                  Blog
                </Link>
              </li>

              <li>
                <div className="sm:hidden">
                  <ThemeToggle />
                </div>
              </li>
            </ul>
          </div>
        </div>
      </nav>
    </div>
  );
};

export default Header;
